// ====================== 工具函数定义 ====================== //

/**
 * 发送登录请求，获取新的 token
 */
function sendLoginRequest() {
    // 获取环境里的前置URL
    const baseUrl = pm.request.getBaseUrl();

    // 从环境变量获取登录凭据
    const username = pm.environment.get("LOGIN_USERNAME");
    const password = pm.environment.get("LOGIN_PASSWORD");

    // 检查必要的环境变量是否设置
    if (!username || !password) {
        console.error("登录失败: LOGIN_USERNAME 或 LOGIN_PASSWORD 环境变量未设置");
        return;
    }

    // 构造登录请求
    const loginRequest = {
        url: baseUrl + "/api/v1/auth/login",
        method: "POST",
        header: {
            "Content-Type": "application/json",
        },
        body: {
            mode: 'raw',
            raw: JSON.stringify({
                "identifier": username,
                "password": password
            }),
        }
    };

    // 发送请求
    pm.sendRequest(loginRequest, function (err, res) {
        if (err) {
            console.error("登录请求失败:", err);
            return;
        }

        try {
            const jsonData = res.json();

            // 检查接口返回是否成功
            if (!jsonData.success) {
                console.error("登录失败:", jsonData.message || "未知错误");
                return;
            }

            // 提取token信息
            const tokenData = jsonData.data;

            // 将token信息写入环境变量
            pm.environment.set("ACCESS_TOKEN", tokenData.access_token);
            pm.environment.set("REFRESH_TOKEN", tokenData.refresh_token);
            pm.environment.set("TOKEN_TYPE", tokenData.token_type);

            // 将过期时间转换为本地时间戳存储
            const expiresAt = new Date(tokenData.access_token_expires_at * 1000);
            pm.environment.set("ACCESS_TOKEN_EXPIRES", expiresAt.toISOString());

            console.log("登录成功，token已更新");

        } catch (parseError) {
            console.error("解析登录响应失败:", parseError);
        }
    });
}

/**
 * 使用 refresh token 刷新 access token
 */
function refreshAccessToken() {
    const baseUrl = pm.request.getBaseUrl();
    const refreshTokenValue = pm.environment.get("REFRESH_TOKEN");  // 修改变量名避免冲突

    if (!refreshTokenValue) {
        console.log("没有可用的refresh token，尝试重新登录");
        sendLoginRequest();
        return;
    }

    const refreshRequest = {
        url: baseUrl + "/api/v1/auth/refresh-token",
        method: "POST",
        header: {
            "Content-Type": "application/json",
            "Authorization": `Bearer ${refreshTokenValue}`  // 使用新变量名
        }
    };

    pm.sendRequest(refreshRequest, function (err, res) {
        if (err) {
            console.error("刷新token失败:", err);
            // 刷新失败则尝试重新登录
            sendLoginRequest();
            return;
        }

        try {
            const jsonData = res.json();

            if (!jsonData.success) {
                console.error("刷新token失败:", jsonData.message || "未知错误");
                // 刷新失败则尝试重新登录
                sendLoginRequest();
                return;
            }

            const tokenData = jsonData.data;

            // 更新环境变量中的token信息
            pm.environment.set("ACCESS_TOKEN", tokenData.access_token);
            pm.environment.set("REFRESH_TOKEN", tokenData.refresh_token);

            const expiresAt = new Date(tokenData.access_token_expires_at * 1000);
            pm.environment.set("ACCESS_TOKEN_EXPIRES", expiresAt.toISOString());

            console.log("token刷新成功");

        } catch (parseError) {
            console.error("解析刷新token响应失败:", parseError);
            sendLoginRequest();
        }
    });
}

/**
 * 检查token状态并决定是否需要登录或刷新
 */
function checkTokenStatus() {
    const accessToken = pm.environment.get("ACCESS_TOKEN");
    const accessTokenExpires = pm.environment.get("ACCESS_TOKEN_EXPIRES");
    const refreshToken = pm.environment.get("REFRESH_TOKEN");

    // 如果没有access token，直接登录
    if (!accessToken) {
        console.log("没有access token，执行登录");
        sendLoginRequest();
        return;
    }

    // 如果有过期时间信息
    if (accessTokenExpires) {
        const expiresDate = new Date(accessTokenExpires);
        const now = new Date();
        const bufferSeconds = 300; // 5分钟缓冲时间

        // 如果token已过期
        if (expiresDate <= now) {
            console.log("access token已过期");
            // 如果有refresh token，尝试刷新
            if (refreshToken) {
                console.log("尝试使用refresh token刷新");
                refreshAccessToken();  // 调用修改后的函数名
            } else {
                console.log("没有refresh token，执行登录");
                sendLoginRequest();
            }
        } 
        // 如果token即将过期（在缓冲时间内）
        else if ((expiresDate - now) / 1000 <= bufferSeconds) {
            console.log("access token即将过期，尝试刷新");
            if (refreshToken) {
                refreshAccessToken();  // 调用修改后的函数名
            } else {
                console.log("没有refresh token，执行登录");
                sendLoginRequest();
            }
        } else {
            console.log("access token仍然有效");
        }
    } else {
        // 如果没有过期时间信息，保守起见每次请求都刷新
        console.log("没有token过期信息，尝试刷新");
        if (refreshToken) {
            refreshAccessToken();  // 调用修改后的函数名
        } else {
            console.log("没有refresh token，执行登录");
            sendLoginRequest();
        }
    }
}

// ====================== 执行入口 ====================== //
checkTokenStatus();
